     .,PI,PJ,PK,PL,PM,PN,PO,PP,PQ,PR,PS
      DIMENSION C(8)                                                    
      SAVE
      S1=A(6)**2
      S2=A(93)**2
      S3=A(93)**4
      C(1)=+S2*(S1*(7*S1-5*S2)+4*S3)
      C(2)=+S1*(-2*S2-S1)+8*S3
      C(3)=+4*S2+3*S1
      S4=A(6)**4
      C(4)=+6*(S3+S4)
      C(5)=+12*S2
      C(6)=+4*(S2+S1)
      S5=A(148)**2
      C(7)=+S5*S4*A(2)
      S6=A(1459)**2
      C(8)=+2*A(1462)*S6*A(167)*A(151)*A(93)*A(1)
      RETURN
      END

